import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const FDetailPagesContainer = styled.div`
    width:100%;

    .contentContainer{
        max-width:1200px;
        margin: 0 auto;

        .topContent{
            .titleWrap{
                width:100%;
                border-top:3px solid #333333;
                border-bottom: 1px solid #D9D9D9;
                height:80px;
                display: flex;
                justify-content: space-between;
                align-items: center;
                padding:0 20px;

                .title{
                    height: auto;
                    font-size:28px;
                    font-weight: 500;
                }

                .date{
                    width:max-content;
                    white-space: nowrap;
                    text-align: left;
                    color: #959595;
                }
            }

            .bannerImgWrap{
                width:800px;
                margin:50px auto;

                .img{
                    max-width: 800px;
                    text-align: center;
                }
            }
        }
        .summaryWrap{
            margin-top:60px; 

            .title{
                height: auto;
                font-size:24px;
                font-weight: 500;
                margin-bottom:20px;
            }

            .formTable{
                width:100%;

                tbody{
                    border-top:2px solid #333333;

                    tr{
                        height: auto;
                        line-height: 1.3;
                        border-bottom:1px solid #D9D9D9;

                        .row{
                            padding:20px;
                            vertical-align: middle;
                        }

                        td{
                            padding:20px;
                            vertical-align: middle;
                        }
                    }
                }
            }
        }
    }

`;

const FDetailPages = memo(() => {
    return (
        <FDetailPagesContainer>
            <Title title='창업지원' txt='당신의 빛나는 미래 사업을 응원합니다.' />
            <div className='contentContainer'>
                <div className='topContent'>
                    <div className='titleWrap'>
                        <h2 className='title'>2024년 청년창업 드림카 지원사업</h2>
                        <span className='date'>2024-01-02 등록</span>
                    </div>
                    <div className='bannerImgWrap'>
                        <img src='/img/fousup/banner/f01_banner.jpg' className='img' alt='배너이미지' />
                    </div>
                </div>
                <div className='summaryWrap'>
                    <h1 className='title'>정책요약</h1>
                    <table className='formTable'>
                        <colgroup>
                            <col style={{width:"12%", backgroundColor:"#f5f5f5"}}></col>
                            <col style={{width:"38%"}}></col>
                            <col style={{width:"12%", backgroundColor:"#f5f5f5"}}></col>
                            <col style={{width:"38%"}}></col>
                        </colgroup>
                        <tbody>
                            <tr>
                                <th className='row'>정책번호</th>
                                <td>R2024011018650</td>
                                <th className='row'>정책 분야</th>
                                <td>일자리</td>
                            </tr>
                            <tr>
                                <th className='row'>정책 소개</th>
                                <td colSpan={3}>차량을 이용한 관련 업종 창업이나 업무에 활용 시 차량 구입비 일부 지원 및 창업 관련 교육(세무, 마케팅 등) 지원</td>
                            </tr>
                            <tr>
                                <th className='row'>지원내용</th>
                                <td colSpan={3}>□ 차량을 이용한 관련 업종 창업이나 업무에 활용시 차량 구입비 일부 지원 및 창업관련 교육(세무, 마케팅 등) 지원</td>
                            </tr>
                            <tr>
                                <th className='row'>지원 규모(명)</th>
                                <td>청년창업가 5명 내외</td>
                                <th className='row'>비고</th>
                                <td></td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
            
        </FDetailPagesContainer>
    );
});

export default FDetailPages;
